import React, { Component } from 'react';
import logo from './logo.svg';
import './App.css';
import Vitamins from './Components/MyPortfolio/MyPortfolio'

class App extends Component {
  state = {
    vitamins : [],
    vitaminD : 0
  }

  myFunc = e => {
  e.preventDefault();
  var x = document.getElementById("myProgress");
  x.value = document.getElementById("value").value;

  this.setState({
    vitaminD : x
  })
}

  render() {
    return (
      <Vitamins 
        increment = {this.myFunc}
      />
    );
  }
}

export default App;
